DROP TABLE IF EXISTS actors;
CREATE TABLE IF NOT EXISTS actors(
   id         INTEGER  NOT NULL
  ,persons_id INTEGER  NOT NULL
  ,PRIMARY KEY(id,persons_id),
   CONSTRAINT fk_id_m
      FOREIGN KEY(id) 
	  REFERENCES movies(id),
   CONSTRAINT fk_persons_actoris
      FOREIGN KEY(persons_id) 
	  REFERENCES persons(persons_id)
);
